import React from "react";

const Posts = ({ posts }) => {
  <h1>Posts</h1>;
  return posts.map((posts, index) => {
    return (
      <div>
        <div key={index}>
          <h3>{posts.title}</h3>
          <p>{posts.description}</p>
          <p>{posts.price}</p>
          <p>{posts.author.username}</p>
          <p>{posts.location}</p>
        </div>
      </div>
    );
  });
};

export default Posts;
